import React from "react";
import Footertop from "./Footertop";
import Footermiddle from "./Footermiddle";
import Footerbottom from "./Footerbottom";

const Footer = () => {
  return (
    <>  
        <Footertop/>
        <Footermiddle/>
        <Footerbottom/>
    </>
  )
}


export default Footer;
